$(document).ready(function(){$(".carousel").carousel({interval:5000});$("#fillingPlaceTab").find("a").click(function(d){d.preventDefault();$(this).tab("show")});var c;var b=new google.maps.LatLng(21.005321,105.84715);var a=new google.maps.LatLng(21.006347,105.846906);c=new google.maps.Map(document.getElementById("map-canvas"),{zoom:15,center:b,mapTypeId:google.maps.MapTypeId.ROADMAP});new google.maps.Marker({position:b,map:c,draggable:false,animation:google.maps.Animation.DROP});new google.maps.Marker({position:a,map:c,draggable:false,animation:google.maps.Animation.DROP});$("#fillingPlaceTab").find("a").on("shown",function(g){var f=$(g.target).attr("href");var d;switch(f){case"#collaborator-viet-dung":d=b;break;case"#collaborator-vi-song":d=a;break;default:break}c.panTo(d)})});